import React from 'react'
import {Wrapper, Title} from '../Styled'
import styled from 'styled-components'
import MinimalIcon from '@material-ui/icons/FiberManualRecord';
import MobileIcon from '@material-ui/icons/PhoneIphone';
import ComponentIcon from '@material-ui/icons/Cached';


const CardContainer = styled(Wrapper)`
    width: 100%;
    display:flex;
    flex-direction:row;
`

const ValueCard = styled.div`
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:space-around;
    height:20em;
    width:15em;
    border: 10px solid var(--s-3);
` 

export default function Values() {
    return (
        <Wrapper>
            <CardContainer>
                <ValueCard>
                    <MinimalIcon/>
                    minimal
                </ValueCard>
                <ValueCard>
                    <MobileIcon/>
                    mobile first 
                </ValueCard>
                <ValueCard>
                    <ComponentIcon/>
                    component based
                </ValueCard>
            </CardContainer>
        </Wrapper>
    )
}
